import React from "react";
import { BrowserRouter as Router, Routes, Route, BrowserRouter } from "react-router-dom";

import NavMenu from "./Navbar/Nav";
import Home from "./Views/Home";
import Raghad from "./Views/Raghad";
import Russ from "./Views/Russ";
import DatPage from "./Views/Dat";

function App (){
  return (

<BrowserRouter>

    <Router>
      <NavMenu />

      <Routes>
        <Route path="/" element={<Home/>}></Route>
        <Route path="/Dat" element={<DatPage/>} ></Route>
        <Route path="/Raghad" element={<Raghad/>} ></Route>
        <Route path="/Russ" element={<Russ/>} ></Route>
      </Routes>
    </Router>
    </BrowserRouter>
  );
};
export default App;
